import React from 'react';
import { Router } from '@reach/router';
import './App.css';
import LandingPage from './views/LandingPage';
import Create from './views/Create';

function App() {
  return (
    <div className="App">
     <Router>
       <LandingPage path="/"/>
       <Create path="/new" />
     </Router>
    </div>
  );
}

export default App;
